% close(h2);

count = 0;
color_scale = (max_bf_contrast_interest - min_bf_contrast_interest)/(1000^2);
for i = 1:1000
    for j = 1:1000
        construct_img_interest(i,j) = min_bf_contrast_interest + count*color_scale;
        count = count + 1;
    end
end

assignin('base','construct_img_interest', construct_img_interest);

h5 = figure;
imagesc(construct_img_interest);
hold on;
colorMap = gray(512);
colormap(colorMap);

set(gcf,'Position', [0 0 1500 1000]);
set(gca,'FontSize', 50, 'LineWidth', 1);
pbaspect([1 1 1]);

yticks([]);
xticks([]);

ticks = linspace(min_bf_contrast_interest,max_bf_contrast_interest,5);
ticks = round(ticks*100)/100;
ticks(1) = ticks(1) - 0.00075;
ticks(end) = ticks(end) - 0.00025;
ticks
%
%  
cbh = colorbar('Ticks', ticks,'TickLabels', {'0.14', '0.19', '0.24', '0.28', '0.33'},'LineWidth',5,'TickDirection','out','Position',[0.8, .118, .03, .8]);
